_url:"https://ewayscooters.com",isActive:Z,published_at:"2021-12-10T16:17:27.465Z",roles:[{_id:X_,name:Ma,__v:0,id:X_}],createdAt:"2021-12-10T16:17:26.226Z",updatedAt:"2022-01-22T17:48:02.909Z",__v:1,category:{_id:c,title:k,published_at:j,createdAt:G,updatedAt:P,__v:0,id:c},id:Be}],categories:[k,"Email"],selectedCategory:"all"},root:{appLoading:!1,testimonials:[{_id:Y_,body:"Trayvon is very patient, knowledgeable, understanding and was able to answer all my questions in an articulate and digestible manner. He went above and beyond not only to answer my questions but also to make sure I left the call without any more confusion. He also provided many more resources, tips, and tricks on essential software development concepts.",name:"Gravielr",url:$_,createdAt:"2022-01-19T01:23:04.698Z",updatedAt:"2022-01-19T22:45:51.648Z",__v:0,id:Y_},{_id:eh,body:"Trayvon is a diamond in the rough on the Upwork marketplace. We have found that for every 5 hires made on Upwork, only about 1 will work out. Trayvon did a test project with us and went above and beyond on it. He's a great communicator and a skilled JavaScript developer. We are now hiring him for an important Vue project.",name:"Bloom CU(Ryan)",url:ah,createdAt:"2022-01-19T19:36:01.510Z",updatedAt:"2022-01-19T22:04:24.344Z",__v:0,id:eh},{_id:th,name:"Curtis",body:"Trayvon is as excellent a programmer as he is a teacher. I could tell that he has excellent knowledge and experience in what he does. I had a problem with my website. Rather than simply help me fix it, he went ahead to teach me how to avoid or solve such problems should I ever have any. I'm grateful, and 100% recommend him.",url:$_,createdAt:"2022-01-19T22:45:39.589Z",updatedAt:"2022-01-19T22:45:39.618Z",__v:0,id:th},{_id:$t,body:"I am a beginner to Javascript and Tray was a great help in learning a particular concept that I have been stuck on. He is very knowledgeable and willing to work at my pace. Highly recommend!",name:"Rhophi",url:sh,createdAt:"2022-01-19T22:51:33.972Z",updatedAt:"2022-01-19T22:51:34.151Z",__v:0,avatar:{_id:ih,name:"https://fiverr-res.cloudinary.com/image/upload/f_auto,q_auto,t_profile_small/v1/attachments/profile/photo/7551b80597b216230b75f9189ab00c42-839122501638710507565/JPEG_20211205_082146_7282743047155746190.jpg",alternativeText:s,caption:s,hash:"JPEG_20211205_082146_7282743047155746190_bccee8b1c9",ext:".jpg",mime:_h,size:2.12,width:100,height:100,url:"https://personal-file-storage.s3.amazonaws.com/JPEG_20211205_082146_7282743047155746190_bccee8b1c9.jpg",provider:i,related:[$t],createdAt:"2022-01-19T22:51:19.800Z",updatedAt:"2022-01-19T22:51:34.088Z",__v:0,id:ih},id:$t},{_id:hh,body:"This was my first project with Trayvon - well done to him for solving it perfectly.. He came in on short notice, and worked with a somewhat informal requirement",name:"Shaun Indra",url:ah,createdAt:"2022-01-19T22:52:40.845Z",updatedAt:"2022-01-19T22:52:40.958Z",__v:0,id:hh},{_id:es,body:"Third time working with Tray, he's been helping me tremendously with moving in the right direction for specific functionality I want to build in my app. Definitely will keep working with him in the future and recommend him to anybody wanting to develop a modern full-stack web application.",name:"Ryukyra",url:sh,createdAt:"2022-01-19T22:53:33.023Z",updatedAt:"2022-01-19T22:53:33.211Z",__v:0,avatar:{_id:mh,name:"https://fiverr-res.cloudinary.com/image/upload/f_auto,q_auto,t_profile_small/v1/attachments/profile/photo/90080850afee0a1405a80ef810f9f079-1577144899699/8e93efe2-2fc1-414b-995b-022279e9bfe5.png",alternativeText:s,caption:s,hash:"8e93efe2_2fc1_414b_995b_022279e9bfe5_a6e61117b7",ext:a,mime:_h,size:2.28,width:100,height:100,url:"https://personal-file-storage.s3.amazonaws.com/8e93efe2_2fc1_414b_995b_022279e9bfe5_a6e61117b7.png",provider:i,related:[es],createdAt:"2022-01-19T22:48:38.094Z",updatedAt:"2022-01-19T22:54:15.437Z",__v:0,id:mh},id:es}]}}}}("image/png",".png",null,"","aws-s3",500,750,1e3,245,156,96,"5f7bc2a78aa62f001752ede9
